function App() {
  return (
    <div className="App">
      <header className="header">
          <div className='container'>
            <ul>
              <li>
                <a href="http://localhost:3000/" >
                  <img src="juejin.svg" alt="掘金" />
                </a>  
              </li>

              <li>
                <div style={{
                            display: 'inline-block',
                            width: '208px',
                            height: '100%',
                            background: `url("${thumb[0]}") center center / cover no-repeat`,
                        }}>
                  <span className='menu-span'>首页</span>
                </div>
                <div className='menu2'>111</div>
              </li>
            </ul>
          </div>



      </header>
    </div>
  );
}

export default App;
